import React from 'react'
import ReactDom from "react-dom"

class Test  extends React.Component{




    render() {
        return(<div><TableHead/><TableData/></div>)
    }

}

class TableData extends React.Component {


    constructor() {
        super();
        this.state = {
            data: [],

            setPreview: function (index, data) {


                        this.data[index] = data;


            },

            getPreview: function () {
                return this.data;
            }
        };
        this.actionEvent = this.actionEvent.bind(this);

    }

    actionEvent() {
         var menuItems=[];
         menuItems.push(3)
         var str=Array.from(menuItems);

             try {
                 str[0].toLocaleLowerCase();
                 this.state.setPreview(0,str[0])
             }catch (e) {
                 alert("Not a number")
             }



     }

     render() {
         return (<div><input type="text" id="text"/><input type="button" value="state" onClick={this.actionEvent}/><div>{this.state.getPreview()[0]}</div></div>)
     }
}
TableData.defaultProps={

    tool:"Dagger",
    vehicle:"Amore"
}


class TableHead extends React.Component{

    render() {
        return(<div><tbody><tr><th>Head</th><th>Nose</th></tr></tbody></div>);
    }

}
class Heading extends React.Component{

    render() {
        return(<div>Movie Vegas</div>);
    }

}


export default TableData;
